column5:
compiler: Restore previous behavior of skipping unsafe import.

If its code were to be generated, package unsafe ends up largely empty:

	$packages["unsafe"] = (function() {
		var $pkg = {}, $init;
		$init = function() {
			$pkg.$init = function() {};
			...
		};
		$pkg.$init = $init;
		return $pkg;
	})();

It contains an empty (aside from goroutine/blocking bookkeeping code) init
function, and that's the only thing that gets called by other packages.

So, we don't want to start including it. This change restores the previous
behavior (with Go 1.8) of skipping it.

Helps https://github.com/gopherjs/gopherjs.github.io/issues/67#issuecomment-324966268.
Related to https://golang.org/cl/37694.

compiler/natives/src/math/big: Use math_big_pure_go build tag.

Give the *build.Context variable a shorter, more common name "bctx".

Resolves the following TODO comment:

	// TODO: Consider using math_big_pure_go build tag for this package, instead of
	//       defining all these pure Go low level operators ourselves.

compiler/natives/src/crypto/x509: Update package and tests for Go 1.9.

Skip new Go 1.9 Linux-only test TestEnvVars that depends on system
roots, which GopherJS doesn't support. This is quite okay, as they're
not supported on Windows either:

	func SystemCertPool() (*CertPool, error) {
		if runtime.GOOS == "windows" {
			// Issue 16736, 18609:
			return nil, errors.New("crypto/x509: system root pool is not available on Windows")
		}

		return loadSystemRoots()
	}

Return non-nil error in loadSystemRoots so that x509.SystemCertPool
correctly reports a failure. As a result, need to skip
TestSystemCertPool now too.

There's no need to override execSecurityRoots, because nothing needs or
calls it (the things that do are overridden or skipped).

compiler/natives/src/net/http: Use context for request cancelation.

The http.Request.Cancel field is deprecated:

	// Deprecated: Use the Context and WithContext methods
	// instead. If a Request's Cancel field and context are both
	// set, it is undefined whether Cancel is respected.
	Cancel <-chan struct{}

See https://godoc.org/net/http#Request.Cancel.

It's okay to drop support for Cancel because implementing it is
optional:

	// Not all implementations of RoundTripper may support Cancel.

Tested externally.

Regenerate.

compiler/natives/src/net/http: Close request body in XHRTransport.

The http.RoundTripper interface (https://godoc.org/net/http#RoundTripper) says:

	// RoundTrip should not modify the request, except for
	// consuming and closing the Request's Body.
	//
	// RoundTrip must always close the body, including on errors,
	// but depending on the implementation may do so in a separate
	// goroutine even after RoundTrip returns.

Close request body in XHRTransport.RoundTrip to satisfy the interface contract.
